jZ.V(null,new S(null,2,5,U,[Pu,mw],null),function(){return"\n### Terms of Service\n\n#### About these Terms\n\nThese are our terms and conditions. If you access AI Sensei, we assume you accept them in full. If you don't, please don't continue to use AI Sensei.\n\nWe have the right to change this website and these Terms of Service in the future. We will notify you of any substantial changes the next time you use AI Sensei. However, it is your responsibility to review the terms and conditions for changes yourself. By continuing to use AI Sensei, you accept the modified terms.\n\nThese terms control the relationship between the owners of ai-sensei.com (see \"Imprint\") and you. They do not create any third-party rights or claims.\n\nGerman law is applied to these terms or service. This does not affect any consumer rights you may be entitled to by the laws of your country of residence.\n\nIf any of these terms is held to be illegal or invalid, it will be replaced by the valid term closest in meaning to the original terms. The validity of other terms is not affected by this.\n\n\n#### Free Contents\n\nAI Sensei offers a lot of game reviews, news articles, etc. These contents can be used without the need to register or log in. However, this content may be modified or removed at any time.\n\n#### Registration\n\nBy registering an account, you assure to use that account for yourself only and not share it with other users. You also need to make sure to not disclose your password to other people.\n\nTo register, you need to have reached the age of majority in your jurisdiction. Minors may only use AI Sensei under supervision by an adult.\n\n#### Buying Credits\n\nBy buying credits on this site, a contract is made between you and the site owner (see \"Imprint\"). The purpose of this contract is selling automated game reviews with the use of Leela Zero or similar Go AIs.\n\n#### Warranty / Disclaimers\n\n**After buying credits, within the next 14 days you are allowed to return them and get your money back if none of the acquired credits have been spent yet. In this case, send a refund request to [ai.sensei.info@gmail.com](mailto:ai.sensei.info@gmail.com). You can use this template and replace the square brackets with the corresponding data:**\n\x3chr/\x3e\n```\nRefund Request\n\nI, [name], hereby want to return the [amount] credits bought on [date].\n```\n\x3chr/\x3e\n**Apart from what is specified here, we do not make any commitments about the content, quality, availability, relyabiliy, or usefulness of our services. Depending on your jurisdiction, additional warranties might be required by law. However, to the extend permitted by law, we exclude all further warranties.**\n\n#### Uploading Games for Credits\n\nWith the previously bought credits, you acquired the right to upload SGF files of games and receive automated reviews for them. However, the upload might be rejected if deemed invalid by our software.\n\nWe offer the following analysis qualities:\n\n* Silver: For 1 credit, 1000 playouts per move of Leela network #157 or better\n* Gold: For 5 credit, 10000 playouts per move of Leela network #157 or better\n\nWe might change the offered playout counts in the future to make up for larger and thus computationally more expensive networks, or possible entirely different Go AIs. The resulting analysis quality should be at least of a comparable quality.\n\n#### Analysis Speed\n\nUsually, a review should take about 5 minutes to finish. However, due to high demand, server problems or other issues, there might be cases where it takes longer. Thus we won't guarantee any review speed at all.\n\nIf your review does get stuck for a long time, please send us an email for support.\n\n#### Analysis Correctness\n\nAlthough the AIs we use are usually playing at super human strengh, there can always be mistakes. We do not give any guarantees regarding the correctness of any of the analysis.\n\n#### Review Downloads\n\nReview SGF files downloaded from AI Sensei are meant for private, non-commercial purposes only. A written permission is required for any other means of use.\n\n#### Cheating\n\nYou are not allowed to use AI Sensei for cheating on Go servers or in tournaments. We might investigate any cheating claims that come to our attention by looking at the games in question. If we come to the conclusion that you cheated, we might share that information with the tournament organizer / Go server staff in question. We might also exclude you from the website completely, even if you still own credits.\n\nSeriously, just don't cheat!\n\n#### Termination of these Services\n\nIf we decide to stop offering these services, we will notify you 6 months in advance to give you enough time to use your remaining credits and download all of your reviews. This doesn't apply if we are forced to shut it down because of bankruptcy, a law suit or the threat of it.\n\n#### Liability\n**Unless required by law, we wil not be responsible for any losses or negative consequences that arise from using our services.**\n\n**The total liability of us or our suppliers and distributors is limited to the amount actually paid to us for any claims under these terms.**\n\n**We will in no case be liable for any loss or damage that wasn't reasonable forseeable.**\n\n#### Business uses\n\nWhen using this website on as a business or on behalf of a business, that business accepts these terms and conditions. It will relieve us and all our affiliates, employees, officers and agents from any claim, action, or suit arising from the use of our services. This includes any liability or expense from losses, damages, claims, actions, suits, litigation costs and attorneys' fees.\n"});
jZ.V(null,new S(null,2,5,U,[Pu,Mr],null),function(){return"\n### Privacy\n- Your email address and user data won't be shared with third parties.\n- We will only use your email address to contact you in case of failures or complaints.\n- We use PayPal as a payments processor.\n- We store our data in the EU Google Cloud.\n- Uploaded games set to public will be visible to anyone.\n- Uploaded games set to private will only be visible to yourself and admins.\n- You can delete all of your games whenever you want.\n- We can also delete your complete account upon request by mail.\n"});
jZ.V(null,new S(null,2,5,U,[Pu,CA],null),function(){return"\n#### Game Upload Format\n\nOur servers are supposed to accept Go games in SGF format that satisfy the following conditions:\n* Even games only, no handicap\n* Alternating black and white moves\n* No illegal moves\n* No variations\n* No more than 400 moves played\n\nIf you think your upload has been rejected by mistake, please contact us and we will investigate the issue and, in case we conclude it really is a server problem, try to fix it.\n\n#### Analysis Limitations\nEspecially keep in mind that our AI:\n* Might be very wrong when ladders are involved.\n* Always assumes games wer played with area scoring and 7.5 points komi - even if the uploaded file contains different values.\n"});
